sap.ui.define(["sap/m/MessageToast"],function(e){"use strict";return{onIconPressMoveImageToTaxon:function(t){var n=t.getSource().getBindingContext("images").getObject();var i={filename:n.filename,description:n.description};var a=t.getSource().getBindingContext("taxon").getObject();if(!!a.images&&a.images.length>0){var o=a.images.find(function(e){return e.filename===i.filename});if(o){e.show("Taxon already assigned to image.");return}}if(!a.images){a.images=[i]}else{a.images.push(i)}e.show("Assigned to taxon "+a.name);this.getView().getModel("taxon").updateBindings()},onIconPressUnassignImageFromTaxon:function(t){var n=t.getSource().getBindingContext("taxon").getObject();var i=t.getSource().getBindingContext("taxon").getPath();var a=i.substr(0,i.lastIndexOf("/"));var o=this.getView().getModel("taxon").getProperty(a);var g=o.indexOf(n);if(g===-1){e.show("Can't find image.");return}o.splice(g,1);this.getOwnerComponent().getModel("taxon").refresh()}}});